Actionscript.script:
if (_root.控制目标 == _parent._name)
{
	if (_root.singleSubmit("觉醒晶体", 3))
	{
		_root.发布消息("消耗 觉醒晶体 3个");
	}
	else
	{
		_root.发布消息("觉醒晶体不足，无法使用觉醒技能！请在商城购买觉醒晶体！");
		_parent.动画完毕();
	}
}

_parent.觉醒霸体特效.removeMovieClip();
_parent.attachMovie("觉醒霸体特效","觉醒霸体特效",_parent.getNextHighestDepth(),{});
if(_root.淡出动画.跳转帧 != "pk场")
{
   _parent.刚体控制器.gotoAndStop("刚体开始");
}
_parent.霸体减伤(15);

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力 * (1 + _parent._parent.技能等级 * 0.2);
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 0;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

